  (8, 1, 1, 1, 'Свободные руки с FM-радио   Nokia HS-2R', 'Размер <BR><BR>70х31х18mm <BR><BR>Дополнительные возможности <BR><BR>Это комбинация стерео радио и гарнитуры. Автоматическое переключение между гарнитурой и радио. Заряжается от телефона. Возможность выбора радиостанции в ручном режиме и в режиме автоматического сканирования.', 8, '110', '1', '1', '2009-02-12 15:40:27', '', '', '', '', 'item8', 'category1', '', '', 0),
  (9, 1, 1, 1, 'Свободные руки с FM-радио   Sony-Ericsson HPR-20', 'Звуковые опции <BR><BR>HPR-20 весит 22 грамма, при поступлении звонка автоматически приглушает радио, а после разговора возвращает громкость на прежний уровень. <BR><BR>Дополнительные возможности <BR><BR>Радио HPR-20 и контрольная панель соединены с телефоном специальным шнуром, оборудованным клипсой для одежды. В устройство также вмонирован дисплей с голубой подсветкой, на котором отображаются частота вещания, текущий канал, громкость и индикатор низких частот.', 9, '170', '1', '1', '2009-02-12 15:40:27', '', '', '', '', 'item9', 'category1', '', '', 0),
