Карман (сумка) для мобильного телефона. <br>\\
ТМ <strong>«Wanlima»</strong> - гарантия высокого качества изделия. <br>\\
С момента появления и до сегодняшнего дня фабрика <strong>«Wanlima»</strong> придерживается правил уникального стиля, современного дизайна и высокого качества товара. Продукция <strong>Wanlima</strong> превосходит даже самые высокие требования с точки зрения практичности, удобства и моды. В 2001г. продукция <strong>Wanlima</strong> была одобрена <strong>“Internetional Standards Organization”</strong> соглашением 9001-2000.\\
Все аксессуары для мобильных телефонов TM <strong>Wanlima</strong> изготовлены из натуральной кожи, практичны и удобны в эксплуатации. Для тех, кто идет <br>\\
в ногу со временем, предлагаются модные виды изделий из кожи с выделкой «черепаха», «игуана», «крокодил», а также лаковой обработкой. <br>\\
Можно купить карман (сумочку) для мобильного телефона <strong>Wanlima</strong> со следующими вариантами крепления: скоба, скоба из хромированной стали, шлевка. Все варианты крепления делают изделие <strong>Wanlima</strong> надежным и удобным в эксплуатации.\\
', 1400, '30', '1', '1', '2009-02-12 15:40:34', '', '', '', '', 'item1400', 'category21/category22', '', '', 0),
