  (1, 1, 1, 'ru', 'О компании', '', '<p><b class="tb"><img height="9" border="0" width="13" alt="" src="http://www.mobilization.biz/system_images/pim.gif" />Торговая марка Mobilization - оптово-розничная торговля аксессуарами для мобильных телефонов</b></p>\
<p>&nbsp;<img hspace="4" height="277" align="left" width="200" vspace="4" alt="" src="/files/UserFiles/Image/office.jpg" /> Торговая марка Mobilization представляет Вашему вниманию самый широкий ассортимент аксессуаров для мобильных телефонов, поставляемых со всех уголков нашей страны. Выбирая нашу торговую марку Вы выбераете высокое качество товара, качественный сервис и поддержку. Наша фирма работает на рынке с 2002 года. Имея многолетний опыт работы, мы максимально учитываем интересы и пожелания наших клиентов. Наши технические специалисты ответят на все Ваши вопросы. <br />\
<br />\
Будем рады видеть Вас в наших точках продаж.<br />\
<br />\
<br />\
<br />\
<br />\
</p>\
<p>&nbsp;</p>\
<p>&nbsp;</p>\
<p>&nbsp;</p>\
<p><br />\
<b>Сегодня торговая марка Mobilization это:</b></p>\
<ul>\
    <li>Широкий ассортимент товара - более 10 000 наименований</li>\
    <li>Низкие цены, гибкая система скидок</li>\
    <li>Регулярные поступления аксессуаров на новые модели телефонов</li>\
    <li>Высокое качество товара</li>\
    <li>Низкая граница опта, минимальная партия</li>\
    <li>Доставка товара - любым удобным для клиента способом (по договоренности)</li>\
    <li>Быстрое оформление и формирование заказа</li>\
    <li>Заявки принимаются в любом виде ( по телефону, e-mail, факсу, лично)</li>\
    <li>На весь товар предоставляется гарантия</li>\
    <li>Оплата по наличному или безналичному расчету</li>\
    <li>Клиенту предоставляется персональный менеджер</li>\
